INSERT INTO `blogs` VALUES (1,'Gobierno cuestiona a Virgilio Saquicela y habla de \'intereses\' en juicio político','El ministro de Gobierno, Henry Cucalón, ratificó este lunes 15 de mayo de 2023 que el presidente Guillermo Lasso acudirá a la Asamblea Nacional el martes 16 para defenderse en el juicio político. El funcionario desacreditó a las autoridades del Legislativo.','<p>Cucalón dijo en radio Democracia que la duda está en saber cuál es el objetivo de los <strong>votos</strong> que dieron ese resultado. \"¿Vamos a tener <strong>dignatarios</strong> que son títeres de objetivos inconfesables entre los cuales está la <strong>impunidad</strong> o vamos a tener autoridades que trabajen en favor del <strong>interés general</strong>?\", cuestionó.</p><p>\"Sí, tengo un pacto con <strong>Unes</strong> (Unión por la Esperanza, correísmo), y lo digo al país, y es la<strong> institucionalidad</strong> del Ecuador y es la institucionalidad de la <a href=\"https://www.elcomercio.com/actualidad/politica/asamblea-instala-renueva-autoridades-posesiona-cpccs.html\"><strong>Asamblea</strong>\"</a>, reconoció Saquicela en su discurso luego de ser posesionado.</p><p>El Secretario de Estado sospecha que detrás de ese pacto podría estar una agenda de \"<strong>destrucción</strong>, de ingobernabilidad y anarquía (...) Ese es su <strong>único objetivo</strong> o para lo que le han puesto ahí. Ahí no hay <strong>autonomía</strong> de pensamiento ni de acción. Nulidad absoluta, aquí no nos vamos a<strong> engañar</strong>. Eso es lo que está en juego, lo que está encima de la mesa de la precaria <strong>institucionalidad </strong>que tiene Ecuador\", criticó.</p><p>El funcionario del Ejecutivo dijo que no existió una<strong> alternativa fuerte</strong> que logre enfrentar la mayoría en la Asamblea que sostiene a Saquicela. Mientras, el Gobierno estaba y sigue enfocado en la defensa de <a href=\"https://www.elcomercio.com/actualidad/guillermo-lasso-se-defendera-el-martes-16-de-mayo-a-las-1000-en-su-juicio-politico.html\"><strong>Lasso</strong></a>. \"Hay una mayoría, no para destituir al Presidente, pero sí para poner dignidades que han venido entorpeciendo los actos porque lo único que le interesa es la <strong>desestabilización</strong>\".</p><p><img class=\"image_resized\" style=\"width:39.52%;\" src=\"data:image/jpeg;base64,\"></p>',0,1,1,3,1,1,NULL,'2023-05-15 20:59:57','2023-05-15 21:00:50'),(2,'El segundo interpelante en el juicio político a Guillermo Lasso será Esteban Torres','El asambleísta Esteban Torres (PSC) será interpelante en el juicio político contra el presidente de la República, Guillermo Lasso, por el presunto delito de peculado, previsto para el martes 16 de mayo de 2023.','<p>La designación del legislador se dio este sábado 13 de mayo. Los otros tres solicitantes del juicio, Pedro Zapata (PSC), Rodrigo Fajardo (separado de ID) y Mireya Pazmiño (separada de Pachakutik) decidieron que Torres sea el <strong>segundo interpelante</strong>.</p><p>Esta decisión no se puede apelar y es <strong>totalmente válida</strong>, a pesar de que Torres no sea uno de los proponentes del proceso.</p><p>La convocatoria para la sesión del pleno para el juicio está prevista para este domingo 14 de mayo. La&nbsp;<a href=\"https://www.elcomercio.com/actualidad/politica/asamblea-notificacion-lasso-juicio-politico.html\">Secretaría General de la Asamblea notificó</a>&nbsp;al Primer Mandatario sobre el enjuiciamiento en su contra este jueves.</p><p>El objetivo de este proceso busca la censura y destitución de Lasso.</p><p>&nbsp;</p><p>Espacio Doble</p><div class=\"raw-html-embed\"><blockquote class=\"twitter-tweet\"><p lang=\"es\" dir=\"ltr\">Mensajes que necesito que me lleguen <a href=\"https://t.co/lSLcsdv9hC\">pic.twitter.com/lSLcsdv9hC</a></p>— Clonazepam? (@PibeGrosoo) <a href=\"https://twitter.com/PibeGrosoo/status/1658149286884917250?ref_src=twsrc%5Etfw\">May 15, 2023</a></blockquote> <script async=\"\" src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script></div>',0,1,1,4,1,1,NULL,'2023-05-15 21:36:56','2023-05-15 21:37:07'),(3,'Para editorial 1','Para editorial 1','<p>Para editorial 1</p>',0,1,1,1,1,1,NULL,'2023-05-16 03:24:40','2023-05-16 03:25:14'),(4,'Para editorial 2','Para editorial 2','<p>Para editorial 2</p>',0,1,1,1,1,1,NULL,'2023-05-16 03:24:58','2023-05-16 03:25:08'),(5,'Decreto de la muerte cruzada está listo, afirma Secretario Jurídico de la Presidencia','Decreto de la muerte cruzada está listo, afirma Secretario Jurídico de la Presidencia','<h1>Decreto de la muerte cruzada está listo, afirma Secretario Jurídico de la Presidencia</h1>',0,1,1,1,2290,3,NULL,'2023-05-16 03:44:57','2023-05-16 03:45:55'),(6,'Guillermo Lasso activa la muerte cruzada; disuelve la Asamblea Nacional','El presidente Guillermo Lasso activó la muerte cruzada este miércoles, 17 de mayo de 2023, por grave crisis política y conmoción interna. El anuncio se lo dio en cadena nacional.','<p>Lasso señaló que \"he decididio aplicar el artículo 148 de la Constitución que me otorga la factultad de disolver la Asamblea\".</p><p>Además, puntualizó que solicitó al Consejo Nacional Electoral (CNE) la convocatoria inmediata a <strong>elecciones legislativas</strong> y <strong>presidenciales</strong> para el resto de los <strong>respectivos períodos</strong>. \"Esta es una acción decmocrática, porque devuelve a los ecuatorianos el poder de decidir su futuro\".</p><p>La activación de esta herramienta constitucional se pone en marcha luego de que se cumpliera la <strong>primera jornada del juicio político</strong> en contra del Jefe de Estado que cerró con el debate en el pleno de la Asamblea la noche del martes, 16 de mayo.</p><p>Durante la intervención de varios de los legisladores que fueron parte del debate, señalaron que no temen a la muerte cruzada, hecho con el cual Lasso había advertido activar previo a la jornada de su juicio político.</p><div class=\"raw-html-embed\"><blockquote class=\"twitter-tweet\"><p lang=\"es\" dir=\"ltr\">He firmado el Decreto Ejecutivo 741, con el objetivo de disolver la Asamblea Nacional y solicitar al CNE se convoque a elecciones. <br><br>Ecuatorianas y ecuatorianos: esta es la mejor decisión para darle una salida constitucional a la crisis política y <br>conmoción interna que soporta…</p>— Guillermo Lasso (@LassoGuillermo) <a href=\"https://twitter.com/LassoGuillermo/status/1658805860410245120?ref_src=twsrc%5Etfw\">May 17, 2023</a></blockquote> <script async=\"\" src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script></div><p>&nbsp;</p>',0,1,1,3,3058,4,NULL,'2023-05-17 20:28:57','2023-05-17 20:32:48');
